import { Injectable } from '@angular/core';
import * as FileSaver from 'file-saver';
import * as XLSX from 'xlsx';
// import { Workbook } from 'exceljs';

import { Workbook, Worksheet } from 'exceljs';
import { Filesystem, FilesystemDirectory, FilesystemEncoding } from '@capacitor/filesystem';
import { FileOpener } from '@ionic-native/file-opener';
import { Capacitor } from '@capacitor/core';
import { Plugins } from '@capacitor/core';
const EXCEL_TYPE = 'application/vnd.openxmlformats-officedocument.spreadsheetml.sheet;charset=UTF-8';
const EXCEL_EXTENSION = '.xlsx';

@Injectable({
  providedIn: 'root'
})
export class ExcelService {
  imgBase64 = ""
  constructor() { }

  public exportAsExcelFile(json: any[], excelFileName: string): void {

    const worksheet: XLSX.WorkSheet = XLSX.utils.json_to_sheet(json);
    // console.log('worksheet', worksheet);
    const workbook: XLSX.WorkBook = { Sheets: { 'data': worksheet }, SheetNames: ['data'] };
    // const excelBuffer: any = XLSX.write(workbook, { bookType: 'xlsx', type: 'array' });
    const excelBuffer: any = XLSX.write(workbook, { bookType: 'xlsx', type: 'buffer' });
    this.saveAsExcelFile(excelBuffer, excelFileName);
  }

  private saveAsExcelFile(buffer: any, fileName: string): void {
    const data: Blob = new Blob([buffer], {
      type: EXCEL_TYPE
    });
    FileSaver.saveAs(data, fileName + '_export_' + new Date().getTime() + EXCEL_EXTENSION);
  }
  exportExcel(excelData: { title: any; data: any; headers: any, cellSize: any, titleMerge: any, imgMerge: any, dateMerge: any }) {
    //Title, Header & Data
    const title = excelData.title;
    const header = excelData.headers;
    const data = excelData.data;

    //Create a workbook with a worksheet
    let workbook = new Workbook();
    let worksheet = workbook.addWorksheet('Sales Data');


    //Add Row and formatting
    worksheet.mergeCells(excelData.titleMerge);
    let titleRow = worksheet.getCell('C1');
    titleRow.value = title;
    titleRow.font = {
      name: 'Calibri',
      size: 16,
      underline: 'single',
      bold: true,
      color: { argb: '0085A3' },
    };
    titleRow.alignment = { vertical: 'middle', horizontal: 'center' };
    // console.log(excelData.dateMerge.substring(0,4));

    // Date
    worksheet.mergeCells(excelData.dateMerge);
    let d = new Date();
    let date = new Date().toLocaleDateString();
    let dateCell = worksheet.getCell(excelData.dateMerge.substring(0, 4));
    dateCell.value = date;
    dateCell.font = {
      name: 'roboto',
      size: 12,
      bold: true,
    };
    dateCell.alignment = { vertical: 'middle', horizontal: 'center' };

    //Add Image
    let myLogoImage = workbook.addImage({
      base64: this.imgBase64,
      extension: 'png',
    });
    // let myLogoImage = workbook.addImage({
    //   base64: this.imgBase64,
    //   extension: 'png',
    // });
    worksheet.mergeCells(excelData.imgMerge);
    worksheet.addImage(myLogoImage, excelData.imgMerge);

    //Blank Row
    worksheet.addRow([]);

    //Adding Header Row
    let headerRow = worksheet.addRow(header);
    headerRow.eachCell((cell, number) => {
      cell.fill = {
        type: 'pattern',
        pattern: 'solid',
        fgColor: { argb: '4167B8' },
        bgColor: { argb: '' },
      };
      cell.font = {
        name: "Calibri",
        bold: true,
        color: { argb: 'FFFFFF' },
        size: 12,
      };
      cell.alignment = { vertical: 'middle', horizontal: 'center' }
    });

    // Adding Data with Conditional Formatting
    data.forEach((d: any) => {
      let row = worksheet.addRow(Object.values(d));

      // let sales = row.getCell(6);
      // let color = 'ffffff';
      // let sales_val = sales.value || 0;
      // Conditional fill color
      // if (sales_val < 200000) {
      // color = 'FF9999';
      // }
      // sales.fill = {
      //   type: 'pattern',
      //   pattern: 'solid',
      //   // fgColor: { argb: color },
      // };
      row.alignment = { vertical: 'middle', horizontal: 'center' }
    });

    worksheet.getColumn(1).width = excelData.cellSize.a;
    worksheet.getColumn(2).width = excelData.cellSize.b;
    worksheet.getColumn(3).width = excelData.cellSize.c;
    worksheet.getColumn(4).width = excelData.cellSize.d;
    worksheet.getColumn(5).width = excelData.cellSize.e;
    worksheet.getColumn(6).width = excelData.cellSize.f;
    worksheet.getColumn(7).width = excelData.cellSize.g;
    worksheet.getColumn(8).width = excelData.cellSize.h;
    worksheet.getColumn(9).width = excelData.cellSize.i;
    worksheet.getColumn(10).width = excelData.cellSize.j;
    worksheet.getColumn(11).width = excelData.cellSize.k;
    worksheet.getColumn(12).width = excelData.cellSize.l;
    worksheet.getColumn(13).width = excelData.cellSize.m;
    worksheet.getColumn(14).width = excelData.cellSize.n;
    worksheet.getColumn(15).width = excelData.cellSize.o;
    worksheet.getColumn(16).width = excelData.cellSize.p;
    worksheet.getColumn(17).width = excelData.cellSize.q;
    worksheet.getColumn(18).width = excelData.cellSize.r;
    worksheet.getColumn(19).width = excelData.cellSize.s;
    worksheet.getColumn(20).width = excelData.cellSize.t;
    worksheet.getColumn(21).width = excelData.cellSize.u;
    worksheet.getColumn(22).width = excelData.cellSize.v;
    worksheet.getColumn(23).width = excelData.cellSize.w;
    worksheet.getColumn(24).width = excelData.cellSize.x;
    worksheet.getColumn(25).width = excelData.cellSize.y;
    worksheet.getColumn(26).width = excelData.cellSize.z;
    worksheet.addRow([]);

    //Footer Row
    let footerRow = worksheet.addRow([
      title + ' Report Generated  at ' + new Date().toLocaleDateString() + " " + new Date().toLocaleTimeString(),
    ]);
    footerRow.getCell(1).fill = {
      type: 'pattern',
      pattern: 'solid',
      fgColor: { argb: 'FFB050' },
    };

    //Merge Cells
    worksheet.mergeCells(`A${footerRow.number}:D${footerRow.number}`);

    //Generate & Save Excel File
    // workbook.xlsx.writeBuffer().then((data) => {
    //   let blob = new Blob([data], {
    //     type: 'application/vnd.openxmlformats-officedocument.spreadsheetml.sheet',
    //   });
    //   FileSaver.saveAs(blob, title + '.xlsx');
    // });
    generateAndSaveExcel(title, header, data);
  }

}


// working fine
async function openExcel(filePath: string) {
  try {
    const platform = Capacitor.getPlatform();

    if (platform === 'android' || platform === 'ios') {
      const hasPermission = await requestStoragePermission();

      if (!hasPermission) {
        throw new Error('Storage permission not granted');
      }

      console.log('Opening Excel at path:', filePath);

      // Open the Excel file
      await FileOpener.open(filePath, 'application/vnd.openxmlformats-officedocument.spreadsheetml.sheet');

      console.log('Excel opened successfully');
    } else {
      console.error('Unsupported platform:', platform);
    }
  } catch (error) {
    console.error('Error opening Excel:', error);
    // alert(`Error opening Excel: ${error.message}`);
  }
}

async function requestStoragePermission(): Promise<boolean> {
  if (Capacitor.getPlatform() === 'android') {
    const { Permissions } = Plugins;
    const result = await Permissions['request']({ name: 'storage' });
    return result.state === 'granted';
  } else if (Capacitor.getPlatform() === 'ios') {
    // iOS typically doesn't need explicit permission for file access in app's document directory
    return true;
  }
  return false;
}
async function saveExcelFile(base64String: string, title: any) {
  const excelName =  `${title}_${new Date().getTime()}.xlsx`;
  try {
    // Check if base64 string is correctly formed
    if (!base64String) {
      throw new Error('Invalid base64 string format');
    }
    console.log('checkdataaaaa file saved:', base64String);

    // Write the Excel file
    const result = await Filesystem.writeFile({
      path: excelName,
      data: base64String,
      directory: FilesystemDirectory.Documents,
      // encoding: FilesystemEncoding.UTF8
    });

    const filePath = result.uri;
    console.log('Excel file saved:', filePath);

    // Open the Excel after saving
    alert(`Excel saved at: ${filePath}`);
    openExcel(filePath);
  } catch (error) {
    // console.error('Error saving Excel file:', error.message);
  }
}

function generateAndSaveExcel(title: any, header: any, data: any) {
  const workbook = XLSX.utils.book_new();
  const worksheetData = [header]; // Assuming headers is an array of strings
  data.forEach((row: object) => {
    worksheetData.push(Object.values(row)); // Add each row of data
  });
  const worksheet = XLSX.utils.aoa_to_sheet(worksheetData);
  XLSX.utils.book_append_sheet(workbook, worksheet, 'Sheet1');


  const excelBuffer = XLSX.write(workbook, { bookType: 'xlsx', type: 'array' });
  const excelBlob = new Blob([excelBuffer], { type: 'application/vnd.openxmlformats-officedocument.spreadsheetml.sheet' });

  // Convert Blob to Base64
  const reader = new FileReader();
  reader.onloadend = () => {
    const base64data = reader.result as string;
    saveExcelFile(base64data, title);
  };
  reader.readAsDataURL(excelBlob);
}
